import React from 'react'

function Navbar({ length , Lenght}) {
  return (
	<div className='Navbar'>
		<nav>
			<h2>{length > 0 ? `Barcha kinolar soni: ${length} ta` : "Kino yo'q"}</h2>
			<h3>Ko'rilganlar soni: {LenghtLike()}</h3>
		</nav>
	</div>
  )
}

export default Navbar
